import CartItem from "./CartItem";

export default function CartList({ value }) {
  const cart = { value };

  return (
    <div>
      <div className="container d-none d-md-block">
        <div className="row">
          <div className="col-2-md mx-auto">
            <p>{cart.img}</p>
          </div>
          <div className="col-2-lg mx-auto">
            <p>{cart.title}</p>
          </div>{" "}
          <div className="col-2-lg mx-auto">
            <p>{cart.price}</p>
          </div>{" "}
          <div className="col-2-lg mx-auto">
            <p>cart</p>
          </div>
          <div className="col-2-lg mx-auto">
            <p>REMOVE</p>
          </div>{" "}
          <div className="col-2-lg mx-auto">
            <p>TOTAL</p>
          </div>
        </div>
      </div>

      <CartItem />
    </div>
  );
}
